import React from 'react';

const HeroDetails = ({ hero }) => {
  return (
    <div className="hero-details">
      <h1>{hero.localized_name}</h1>
      <p>{hero.primary_attr}</p>
      <p>{hero.attack_type}</p>
      <p>{hero.roles.join(', ')}</p>
    </div>
  );
};

export default HeroDetails;
